import React from 'react';
//import './App.css';
function click(e) {
  alert('hola');
}

function FeelingComponent(props) {
  return (
    <div className={'FeelingComponent' + ' '+ props.color + ' activeFeeling'} onClick= {click}> 
      {props.feeling} 
    </div>
  );
}

export default FeelingComponent;
